const nodemailer = require("nodemailer"); //发送邮件的node插件
const xlsx = require("node-xlsx");
const sheets = xlsx.parse("1.xls");
const fs = require("fs");

const data = [];

const result = [
  {
    name: "sheet1",
    data: [["名字", "邮箱", "结果"]],
  },
];

sheets.forEach(function (sheet) {
  console.log(sheet["name"]);
  // 读取每行内容
  for (var rowId in sheet["data"]) {
    var row = sheet["data"][rowId];
    data.push(row);
  }
});

function sendEmail(content) {
  let transporter = nodemailer.createTransport({
    service: "QQ", // 发送者的邮箱厂商，支持列表：https://nodemailer.com/smtp/well-known/
    // host: "smtp.vip.163.com",
    port: 465, // SMTP 端口
    secureConnection: true, // SSL安全链接
    auth: {
      //发送者的账户密码
      user: "2352974543@qq.com", //账户
      pass: "", //smtp授权码，到邮箱设置下获取
    },
  });

  data.forEach((item) => {
    const name = item[0];
    const email = item[11];

    let mailOptions = {
      from: "2352974543@qq.com", // 发送者昵称和地址
      to: email, // 接收者的邮箱地址
      subject: "【邀请函】阿里巴巴国际站商家行业交流峰会10.13号", // 邮件主题
      html: content,
    };
    console.log(name, email);

    transporter.sendMail(mailOptions, (error, info) => {
      if (error) {
        result[0].data.push([name, email, "失败"]);
        console.log("失败");
        return console.log(error);
      }
      console.log("成功");

      result[0].data.push([name, email, "成功"]);
      console.log(result);
      if (result[0].data.length - 1 === data.length) {
        var buffer = xlsx.build(result);
        fs.writeFile("a.xlsx", buffer, function (err) {
          if (err) {
            console.log("Write failed: " + err);
            return;
          }
          console.log("Write completed.");
        });
      }
    });
  });
}

